import React from "react";
import { Link } from 'react-router-dom'
import Atendimentos from "../../layouts/Atendimentos";
import Prontuarios from "../../layouts/Prontuarios";
import AreaPaciente from "../../layouts/AreaPaciente";
import Agenda from "../../layouts/Agenda";
import Profissionais from "../../layouts/Profissionais";
import Servicos from "../../layouts/Servicos";
import SobreSistema from "../../layouts/Sobresistema";
import Rodape from "../../layouts/Rodape";
import '../../css/telaInicial.css';
import {
  FaRegHospital,
  FaHandHoldingMedical,
  FaNotesMedical,
  FaUser,
  FaRegCalendarAlt,
  FaUserMd,
  FaSyringe,
  FaInstagram,
  FaPhoneAlt,
  FaEnvelopeOpenText,
  FaFirstAid,
} from "react-icons/fa";

const TelaInicial: React.FC = () => {
  return (
    <div>


      <SobreSistema />

      <section>

        <Atendimentos />
      </section>

      <section>

        <Prontuarios />
      </section>

      <section>

        <AreaPaciente />
      </section>

      <section>

        <Agenda />
      </section>

      <section>

        <Profissionais />
      </section>

      <section>

        <Servicos />
      </section>

      <Rodape />
    </div>
  );
};

export default TelaInicial;
